import { style } from "typestyle";

const InfoProfileStyle = style({
    marginTop: '100px',
    display: 'flex',
    $nest: {
        '& .image-container': {
            position: 'relative',
            height: '600px',
            width: '560px',
            backgroundColor: '#FF7065',
            $nest: {
                '& .ProfilePhoto': {
                    position: 'absolute',
                    top: 20,
                    right: -200
                }
            }
        }
    }
})

export default InfoProfileStyle
